Fonte: https://www.razaoautomovel.com/2022/12/multa-excesso-velocidade-austria

AMONTOAR BRASAS VIVAS

O amor deve ser sincero. Odeiem o que é mau; apeguem-se ao que é bom. Dediquem-se uns aos outros com amor fraternal. Prefiram dar honra aos outros mais do que a vocês. Nunca falte a vocês o zelo, sejam fervorosos no espírito, sirvam ao Senhor. Alegrem-se na esperança, sejam pacientes na tribulação, perseverem na oração. Compartilhem o que vocês têm com os santos em suas necessidades. Pratiquem a hospitalidade. Abençoem aqueles que os perseguem; abençoem-nos, não os amaldiçoem. Alegrem-se com os que se alegram; chorem com os que choram. Tenham uma mesma atitude uns para com os outros. Não sejam orgulhosos, mas estejam dispostos a associar-se a pessoas de posição inferior. Não sejam sábios aos seus próprios olhos. Não retribuam a ninguém mal por mal. Procurem fazer o que é correto aos olhos de todos. Façam todo o possível para viver em paz com todos. Amados, nunca procurem vingar-se, mas deixem com Deus a ira, pois está escrito: “Minha é a vingança; eu retribuirei”, diz o Senhor. Ao contrário: “Se o seu inimigo tiver fome, dê-lhe de comer; se tiver sede, dê-lhe de beber. Fazendo isso, você amontoará brasas vivas sobre a cabeça dele”. Não se deixem vencer pelo mal, mas vençam o mal com o bem. 
Romanos 12:9 - 21 NVI

Paulo nestes poucos textos, nos proporciona uma imensa riqueza de como o cristão deve proceder em toda sua vida. Seu ensino apostólico reflete verdades para sermos santos perante o Senhor.

Agora veremos sucessões de exortações ao dever prático do cristão:

- Amor sincero;
- Odiar o mal;
- Apegar-se ao bem;
- Amor fraternal;
- Honrar outros;
- Ser zeloso;
- Espírito fervoroso;
- Servir a Deus;
- Esperançosos;
- Paciência ;
- Orar;
- Caridade;
- abençoar;
- Nao amaldiçoar;
- Hospitalidade;
- Alegrar-se;
- Chorar;
- Tratar igual;
- Não ser orgulhoso;
- Sejam humildes;
- Simplicidade;
- Não retribuam o mal;
- Sejam corretos;
- Vivam em paz;
- Sem vingança;
- Doações a necessitados;
- Vencer o mal com o bem.

Uma lista enorme para fazermos, né verdade? Esse é o apóstolo Paulo. Nos deixou oportunidades de fazermos algo para Deus. Use seu tempo hoje para meditar em cada exortação que Paulo nos deixou.

Tenhamos todos um excelente domingo, Dia do Senhor!

